function getOidcUserManager(){var n={authority:baseUrls.identityServer,client_id:"graphqlPlaygroundJs",redirect_uri:baseUrls.graphqlPlaygroundJsClient+"/Home/GraphqlPlaygroundAuthCallback",response_type:"id_token token",scope:"openid profile ReactAdvantageApi",post_logout_redirect_uri:baseUrls.graphqlPlaygroundJsClient+"/Home/GraphqlPlayground"};return new Oidc.UserManager(n)}function initGraphqlPlayground(n){GraphQLPlayground.init(document.getElementById("root"),{endpoint:baseUrls.api+"/graphql",env:"dev",config:{extensions:{endpoints:{dev:{url:baseUrls.api+"/graphql",headers:{Authorization:"Bearer "+n.access_token}}}}}})}function logout(){getOidcUserManager().signoutRedirect()}window.addEventListener("load",function(){var n=getOidcUserManager();n.getUser().then(function(t){t?initGraphqlPlayground(t):n.signinRedirect()})});